CREATE TABLE IF NOT EXISTS `#__costbenefitprojection_diseasecategories` (
  `diseasecategory_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `diseasecategory_name` varchar(255) DEFAULT NULL,
  `diseasecategory_alias` varchar(255) DEFAULT NULL,
  `diseasecategory_description` longtext,
  `access` int(11) DEFAULT NULL,
  `published` tinyint(4) DEFAULT NULL,
  `created_by` int(11) NOT NULL DEFAULT '0',
  `created_on` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `checked_out` int(11) NOT NULL DEFAULT '0',
  `checked_out_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `modified_by` int(11) NOT NULL DEFAULT '0',
  `modified_on` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`diseasecategory_id`),
  UNIQUE KEY `diseasecategory_alias` (`diseasecategory_alias`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE IF NOT EXISTS `#__costbenefitprojection_helps` (
  `help_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `help_for` varchar(255) DEFAULT NULL,
  `help_group` varchar(255) DEFAULT NULL,
  `help_link` varchar(255) DEFAULT NULL,
  `location` varchar(255) DEFAULT NULL,
  `help_content` longtext,
  `access` int(11) DEFAULT NULL,
  `published` tinyint(4) DEFAULT NULL,
  `created_by` int(11) NOT NULL DEFAULT '0',
  `created_on` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `checked_out` int(11) NOT NULL DEFAULT '0',
  `checked_out_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `modified_by` int(11) NOT NULL DEFAULT '0',
  `modified_on` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`help_id`),
  UNIQUE KEY `help_link` (`help_link`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE IF NOT EXISTS `#__costbenefitprojection_diseases` (
  `disease_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `diseasecategory_id` int(11) DEFAULT NULL,
  `disease_name` varchar(255) DEFAULT NULL,
  `disease_alias` varchar(255) DEFAULT NULL,
  `disease_description` longtext,
  `access` int(11) DEFAULT NULL,
  `published` tinyint(4) DEFAULT NULL,
  `created_by` int(11) NOT NULL DEFAULT '0',
  `created_on` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `checked_out` int(11) NOT NULL DEFAULT '0',
  `checked_out_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `modified_by` int(11) NOT NULL DEFAULT '0',
  `modified_on` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`disease_id`),
  UNIQUE KEY `disease_alias` (`disease_alias`),
  KEY `diseasecategory_id` (`diseasecategory_id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE IF NOT EXISTS `#__costbenefitprojection_diseasedata` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `disease_id` int(11) DEFAULT NULL,
  `incidence_or_prevalence` int(11) NOT NULL DEFAULT '0',
  `incidence_rate_male` decimal(8,5) NOT NULL,
  `incidence_rate_female` decimal(8,5) NOT NULL,
  `morbidity_rate_reference` text NOT NULL,
  `relative_proportion` decimal(8,5) NOT NULL,
  `relative_proportion_reference` text NOT NULL,
  `mortality_rate_male` decimal(8,5) NOT NULL,
  `mortality_rate_female` decimal(8,5) NOT NULL,
  `mortality_scaling_factor_male` decimal(8,5) NOT NULL,
  `mortality_scaling_factor_female` decimal(8,5) NOT NULL,
  `mortality_rate_reference` text NOT NULL,
  `duration` decimal(8,5) NOT NULL,
  `hospital_stay` decimal(8,5) NOT NULL,
  `incidence_scaling_factor_male` decimal(8,5) NOT NULL,
  `incidence_scaling_factor_female` decimal(8,5) NOT NULL,
  `presenteeism_scaling_factor_male` decimal(8,5) NOT NULL,
  `presenteeism_scaling_factor_female` decimal(8,5) NOT NULL,
  `hospital_scaling_factor_male` decimal(8,5) NOT NULL,
  `hospital_scaling_factor_female` decimal(8,5) NOT NULL,
  `absenteeism_multiplication_factor_male` decimal(8,5) NOT NULL,
  `absenteeism_multiplication_factor_female` decimal(8,5) NOT NULL,
  `disability_weights` tinyint(4) DEFAULT NULL,
  `comment` longtext,
  `access` int(11) DEFAULT NULL,
  `published` tinyint(4) DEFAULT NULL,
  `owner` int(11) NOT NULL DEFAULT '0',
  `country` int(11) NOT NULL DEFAULT '0',
  `created_by` int(11) NOT NULL DEFAULT '0',
  `created_on` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `checked_out` int(11) NOT NULL DEFAULT '0',
  `checked_out_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `modified_by` int(11) NOT NULL DEFAULT '0',
  `modified_on` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `disease_id` (`disease_id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE IF NOT EXISTS `#__costbenefitprojection_risk` (
  `risk_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `risk_name` varchar(255) DEFAULT NULL,
