  `unproductive_scaling_factor_female` decimal(8,5) NOT NULL,
  `access` int(11) DEFAULT NULL,
  `owner` int(11) NOT NULL DEFAULT '0',
  `country` int(11) NOT NULL DEFAULT '0',
  `published` tinyint(4) DEFAULT NULL,
  `created_by` int(11) NOT NULL DEFAULT '0',
  `created_on` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `checked_out` int(11) NOT NULL DEFAULT '0',
  `checked_out_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `modified_by` int(11) NOT NULL DEFAULT '0',
  `modified_on` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `risk_id` (`risk_id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE IF NOT EXISTS `#__costbenefitprojection_interventions` (
  `intervention_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `disease_id` text NOT NULL,
  `risk_id` text NOT NULL,
  `cluster_id` text NOT NULL,
  `intervention_name` varchar(255) DEFAULT NULL,
  `intervention_alias` varchar(255) DEFAULT NULL,
